import React, { Component } from 'react';
import '../App.scss';

class Index extends Component {
    render() {
        return (
            <div className="container">
                <h3>Home</h3>
                <img width="400px" src="https://www.armadilloamarillo.com/wp-content/uploads/Full-stack-developer.png" alt="index" />
            </div>
        )
    }
}

export default Index;
